import React, { Component } from 'react'
import MapContainer from '../src/containers/mapcontainer'
import './index.css';
import SearchForm from '../src/components/searchform.js'
// import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
// import MainDisplay from './src/containers/maindisplay'
// import Map from './src/containers/map'
// import SearchBar from '../src/components/searchbar'



export default class App extends Component {

    state = {
        results:[]
    }

    grabBeaches = (results) => {
        let prevState = this.state.results
        this.setState({...prevState, results})
    }

    render() {

        return (
            <div className="App">
                    <div >
                    <style title="map" style={{height:"500px", width:"500px"}}>
                    {/* <iframe title="map" style={{height:"500px", width:"500px"}}> */}
                    <MapContainer beaches={this.state.results}/>
                    {/* </iframe> */}
                    </style>
                    </div>


                    <div style={{border:"green"}}>
                    <span>
                    <SearchForm grabBeaches={this.grabBeaches}/>
                    </span>
                {/*                     
                    <MuiThemeProvider>
                    <SearchBar/>
                    </MuiThemeProvider> */}
                    </div>


            </div>
        )
    }
}
